import photo3 from '../../public/3.jpeg';
import photo4 from '../../public/4.jpeg';
import dynamic from 'next/dynamic';
const Carousel = dynamic(
    () => import('carousel').then(mod => mod.Editor),
    { ssr: false }
)

const Test = () => {
    return(
        <React.Fragment>
            <div>Carousel</div>
            <Carousel
                imgsrc={[process01, process02, process03]}
                rotateBy={3}
                width={'800px'}
                height={'500px'}
                navigateButton={true}
                controlButton={true}
            />
            <div>Carousel</div>
        </React.Fragment>
    )
}

export default Test;
